import React, { useState } from 'react';
import { useAuth } from '../App';

const Login = () => {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [selectedRole, setSelectedRole] = useState('hr');
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState('');

    const { login } = useAuth();

    const handleSubmit = async (e) => {
        e.preventDefault();
        setLoading(true);
        setError('');

        try {
            const result = await login(username, password);

            if (!result.success) {
                setError(result.error);
            }
        } catch (error) {
            setError('Login gagal. Silakan coba lagi.');
        } finally {
            setLoading(false);
        }
    };

    const handleRoleChange = (role) => {
        setSelectedRole(role);
        // Set default credentials based on role for demo
        switch (role) {
            case 'hr':
                setUsername('hr@company.com');
                setPassword('hr123');
                break;
            case 'management':
                setUsername('manager@company.com');
                setPassword('manager123');
                break;
            case 'admin':
                setUsername('admin');
                setPassword('password');
                break;
            default:
                setUsername('');
                setPassword('');
        }
    };

    return (
        <div className="login-container">
            <div className="login-card">
                <div className="login-header">
                    <h1>Masuk Akun</h1>
                </div>

                <form onSubmit={handleSubmit}>
                    {/* Role Selection Tabs */}
                    <div className="role-tabs">
                        <button
                            type="button"
                            className={`role-tab ${selectedRole === 'hr' ? 'active' : ''}`}
                            onClick={() => handleRoleChange('hr')}
                        >
                            HR
                        </button>
                        <button
                            type="button"
                            className={`role-tab ${selectedRole === 'management' ? 'active' : ''}`}
                            onClick={() => handleRoleChange('management')}
                        >
                            Management
                        </button>
                        <button
                            type="button"
                            className={`role-tab ${selectedRole === 'admin' ? 'active' : ''}`}
                            onClick={() => handleRoleChange('admin')}
                        >
                            Admin
                        </button>
                    </div>

                    {/* Role-specific form content */}
                    {selectedRole === 'hr' && (
                        <>
                            <div className="form-group">
                                <input
                                    type="email"
                                    className="form-control"
                                    placeholder="Alamat Email HR"
                                    value={username}
                                    onChange={(e) => setUsername(e.target.value)}
                                    required
                                />
                            </div>
                            <div className="form-group">
                                <input
                                    type="password"
                                    className="form-control"
                                    placeholder="Kata Sandi"
                                    value={password}
                                    onChange={(e) => setPassword(e.target.value)}
                                    required
                                />
                            </div>
                        </>
                    )}

                    {selectedRole === 'management' && (
                        <>
                            <div className="form-group">
                                <input
                                    type="email"
                                    className="form-control"
                                    placeholder="Alamat Email Management"
                                    value={username}
                                    onChange={(e) => setUsername(e.target.value)}
                                    required
                                />
                            </div>
                            <div className="form-group">
                                <input
                                    type="password"
                                    className="form-control"
                                    placeholder="Kata Sandi"
                                    value={password}
                                    onChange={(e) => setPassword(e.target.value)}
                                    required
                                />
                            </div>
                        </>
                    )}

                    {selectedRole === 'admin' && (
                        <>
                            <div className="form-group">
                                <input
                                    type="text"
                                    className="form-control"
                                    placeholder="Alamat Email Admin"
                                    value={username}
                                    onChange={(e) => setUsername(e.target.value)}
                                    required
                                />
                            </div>
                            <div className="form-group">
                                <input
                                    type="password"
                                    className="form-control"
                                    placeholder="Kata Sandi"
                                    value={password}
                                    onChange={(e) => setPassword(e.target.value)}
                                    required
                                />
                            </div>
                        </>
                    )}

                    {error && (
                        <div className="alert alert-danger" role="alert">
                            {error}
                        </div>
                    )}

                    <button
                        type="submit"
                        className="btn btn-primary w-100"
                        disabled={loading}
                    >
                        {loading ? (
                            <>
                                <span className="spinner-border spinner-border-sm me-2" role="status" aria-hidden="true"></span>
                                Masuk...
                            </>
                        ) : (
                            'Masuk'
                        )}
                    </button>
                </form>

                <div className="text-center mt-3">
                    <small className="text-muted">
                        Demo credentials sudah diisi otomatis berdasarkan role yang dipilih
                    </small>
                </div>
            </div>

            {/* Footer */}
            <div className="footer" style={{position: 'absolute', bottom: 0, width: '100%'}}>
                <div className="footer-links">
                    <a href="#">Tentang Kami</a>
                    <a href="#">Kontak</a>
                    <a href="#">Kebijakan Privasi</a>
                    <a href="#">Ketentuan Layanan</a>
                </div>
                <p>Â©2025 CareerMatch. Semua hak cipta dilindungi.</p>
            </div>
        </div>
    );
};

export default Login;
